import React, { useState } from 'react';

function CheckboxList() {
  const [checkedItems, setCheckedItems] = useState({}); // State to hold checked items

  const handleChange = (event) => {
    setCheckedItems({
      ...checkedItems,
      [event.target.name]: event.target.checked,
    });
  };

  const checkboxItems = [
    { id: 1, user_id: 'user1', nick: 'Nick 1' },
    { id: 2, user_id: 'user2', nick: 'Nick 2' },
    { id: 3, user_id: 'user3', nick: 'Nick 3' },
    // Add more items as needed
  ];

  return (
    <div>
      {checkboxItems.map((item) => (
        <label key={item.id}>
          <input
            type="checkbox"
            name={item.user_id}
            checked={checkedItems[item.user_id] || false}
            onChange={handleChange}
          />
          {item.nick}
        </label>
      ))}
    </div>
  );
}

export default CheckboxList;
